    false,nt"url": null,nt"notes": "This data set consists of land derived
    from high resolution imagery and was analyzed according to the Coastal Change Analysis
    Program (C-CAP) protocol to determine land cover. This data set utilized 35 full
    or partial WorldView2 multispectral scenes and the 2005 high-resolution Kauai C-CAP
    data set. The imagery and base classification were included in a multi-step semi-automated
    change detection process to extract land cover features in the 2010 imagery.",nt"license_title":
